create database floresColas;
grant all privileges on floresColas.* to 'colas'@'%' identified by 'chisela';

create table floresColas.USERS (
	username VARCHAR(50),
	password VARCHAR(32), --encriptacion md5, md5('6vzR4EH')
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	date_of_birth DATE,
	genre VARCHAR(50),
	admin VARCHAR(50)
);

create table floresColas.COLOR (
	code VARCHAR(7),
	name VARCHAR(20),
	description VARCHAR(50)
);

create table floresColas.FLOWER (
	code INT,
	name VARCHAR(50) UNIQUE,
	description VARCHAR(50),
	price DECIMAL(5,2),
	color VARCHAR(50)
);



create table floresColas.SALE (
	username INT,
	floresColas.FLOWER_code VARCHAR(50),
	quantity VARCHAR(50),
	price VARCHAR(50),
	date VARCHAR(50),
	ip_address VARCHAR(20)
);
